    false,nt"url": null,nt"notes": "NODC Accession 0113953 includes biological,
    chemical, discrete sample, physical and profile data collected from HEALY in the
    Arctic Ocean, Beaufort Sea and Bering Sea from 2002-07-18 to 2002-08-21 and retrieved
    during cruise CARINA/32H120020718. These data include ALKALINITY, AMMONIUM, CHLOROPHYLL
    A, DISSOLVED INORGANIC CARBON, DISSOLVED ORGANIC CARBON, DISSOLVED OXYGEN, Delta
    Oxygen - 18, Dissolved Organic Nitrogen, HYDROSTATIC PRESSURE, Lignin, NITRATE,
    NITRITE, PARTICULATE ORGANIC CARBON, PARTICULATE ORGANIC NITROGEN, PHAEOPHYTIN,
    PHOSPHATE, Potential temperature (theta), RADIUM ISOTOPES, SALINITY, SILICATE, Total
    Dissolved Nitrogen (TDN), UREA, WATER TEMPERATURE and thorium isotope. The instruments
    used to collect these data include CTD and bottle. These data were collected by
